import React, { useEffect, useRef, useState } from "react";
import ChatMessage from "./ChatMessage";
import { getGeminiResponse, persistLog } from "./api";

const MOCK_EXPERT_ID = "technician-mock-123";

/**
 * The main component for sending queries and receiving RAG responses.
 * @param {{ initialLog: object | null, onNewLog: function, expertId: string | undefined }} props - Component props.
 */
export default function ChatBox({ initialLog, onNewLog, expertId = MOCK_EXPERT_ID }) {
    const [messages, setMessages] = useState([]);
    const [input, setInput] = useState("");
    const [isLoading, setIsLoading] = useState(false);
    const [logStatus, setLogStatus] = useState("Ready");
    const messagesEndRef = useRef(null);
    
    // Scroll to the bottom on new messages
    useEffect(() => {
        messagesEndRef.current?.scrollIntoView({ behavior: "smooth" });
    }, [messages]);

    // Initialize conversation or load from history
    useEffect(() => {
        if (initialLog && initialLog.user_query && initialLog.ai_response) {
            const queryMessage = { role: "user", text: initialLog.user_query };
            const aiResponseMessage = { role: "ai", text: initialLog.ai_response };
            setMessages([queryMessage, aiResponseMessage]);
            setLogStatus("Loaded from History");
        } else {
            setMessages([
                { role: "assistant", text: "Welcome! Describe the technical issue for a RAG-powered solution." }
            ]);
            setLogStatus("New Session");
        }
    }, [initialLog]);


    async function handlePersistLog(userQuery, aiResponseText) {
        setLogStatus("Saving...");
        const saved = await persistLog(expertId, userQuery, aiResponseText);
        setLogStatus(saved ? "Log Saved" : "Error Saving Log");
        if (saved && onNewLog) {
            onNewLog(); 
        }
    }

    async function sendQuery(e) {
        e.preventDefault();
        const userQuery = input.trim();
        if (!userQuery || isLoading || !expertId) return;

        const userMessage = { role: "user", text: userQuery };
        const loadingMessage = { role: "assistant", text: "Thinking..." }; 
        
        setMessages((prev) => [...prev, userMessage, loadingMessage]);
        setInput("");
        setIsLoading(true);
        setLogStatus("Processing...");
        
        const aiResponseText = await getGeminiResponse(userQuery);
        
        setIsLoading(false);
        setMessages((prev) => {
            const tempMessages = prev.slice(0, -1); // Remove "Thinking..."
            const aiMessage = { role: "ai", text: aiResponseText };
            
            handlePersistLog(userQuery, aiResponseText); 
            
            return [...tempMessages, aiMessage];
        });
    }

    const isInputDisabled = isLoading || !expertId;

    return (
        <div className="flex flex-col h-full bg-white rounded-xl shadow-lg">
            
            {/* Header with Status */}
            <div className="flex justify-between items-center p-4 border-b border-gray-200">
                <h1 className="text-xl font-bold text-gray-800">
                    <span className="text-blue-600">üõ†Ô∏è</span> Technician Chat 
                    <span className="text-sm font-normal text-gray-500 ml-3">(ID: {expertId})</span>
                </h1>
                <span className={`text-sm font-medium ${logStatus.includes("Saved") ? 'text-green-600' : logStatus.includes("Error") ? 'text-red-600' : 'text-gray-500'}`}>
                    Status: {logStatus}
                </span>
            </div>

            {/* Messages Area */}
            <div className="flex-grow overflow-y-auto p-4 space-y-4 custom-scrollbar">
                <style>{`
                    .custom-scrollbar::-webkit-scrollbar { width: 8px; }
                    .custom-scrollbar::-webkit-scrollbar-thumb { background-color: #cbd5e1; border-radius: 4px; }
                    .custom-scrollbar::-webkit-scrollbar-track { background: #f1f5f9; }
                `}</style>
                
                {messages.map((m, i) => (
                    <ChatMessage key={i} message={m} />
                ))}
                
                <div ref={messagesEndRef} />
            </div>

            {/* Input Area */}
            <form className="flex space-x-3 p-4 border-t border-gray-200" onSubmit={sendQuery}>
                <input
                    type="text"
                    placeholder={expertId ? "Type your query..." : "Please log in to start chatting."}
                    value={input}
                    onChange={(e) => setInput(e.target.value)}
                    disabled={isInputDisabled}
                    className="flex-grow p-3 border border-gray-300 rounded-full focus:ring-2 focus:ring-blue-500 focus:border-blue-500 shadow-inner disabled:bg-gray-100 transition"
                />
                <button
                    className="px-6 py-3 bg-blue-600 text-white font-semibold rounded-full hover:bg-blue-700 transition disabled:bg-gray-400 shadow-md active:scale-95 transform"
                    type="submit"
                    disabled={!input.trim() || isInputDisabled}
                >
                    {isLoading ? 'Loading...' : 'Send'}
                </button>
            </form>
        </div>
    );
}
